import React from "react";
import Expenseitem from "./Expenseitem";
import "./ExpensesList.css";

const ExpensesList = (props) => {
  let expenseContent = <p>NO items in this year</p>;
  if (props.items.length > 0) {
    expenseContent = props.items.map((expense, index) => (
      <Expenseitem
        key={expense.id}
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      />
    ));
  }
  return <ul className="expenses">
    
  </ul>

};
export default ExpensesList;
